import React from 'react';

import { BannerContainer, BannerTextBackground, BannerText } from './banner.styles';


const Banner = () => (
  <BannerContainer>
    <BannerTextBackground>
      <BannerText>Book Services</BannerText>
      <button></button>
    </BannerTextBackground>
  </BannerContainer>

);

export default React.memo(Banner);
